import { useContext } from "react";
import { Box, Button, Stack } from "@mui/material";
import { AuthContext } from "../context/Auth";


const Game = () => {


    let { data } = useContext(AuthContext);
    console.log(data);



    return (
        <Box>
          <Stack>  
            {data.map((dataItem) => (
                <p key={dataItem.id}>yolo</p>
            ))}
            </Stack>
        <Button>Next Question</Button>
    </Box>
    );
}

export default Game;
